import React from "react";
import { View, Text, Pressable } from "react-native";
import { useState } from "react";
import { style } from "../stylesheets/navbarstyle";

interface VisibilityProp {
    visible: boolean
}

export default function Circles({visible} : VisibilityProp) {

    if(visible) {
        return (
            <View id="wrapper">
                <Pressable id="circle-diets"></Pressable>
                <Pressable id="circle-programs"></Pressable>
                <Pressable id="circle-forum"></Pressable>
            </View>
        )
    }
}
